import PropTypes from 'prop-types'


const Header = ({title}) => {
  return (
    <header className='header'>
      <h1>Task Management System</h1>
      <h1>{title}</h1>
      <button cl>Add</button>
    </header>
  )
}

Header.defaultProps = {
    title: 'Task Tracker'
};

Header.propTypes = { 
    title: PropTypes.string.isRequired,
};

export default Header
